import React, { Component } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import SignIn from './components/SignIn-SignUp/SignIn_Form';
import SignUp from './components/SignIn-SignUp/SignUp_Form';

class App extends React.PureComponent
{
    render()
    {
        return(
            <>
            <SignIn/>
            <SignUp/>
            </>
        )
    }
}
export default App;
